import React from 'react';
import ReactDOM from 'react-dom';
import "./style.css";

const App = () => {
    return(
        <div className='App'>
            Hello World
        </div>
    );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App/>, rootElement); /**Renderiza os elementos*/
